# https://query.wikidata.org/sparql
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>

SELECT ?lipidEntity ?lipidEntityLabel 
WHERE {
  SERVICE <https://query.wikidata.org/sparql> {
    ?lipidEntity wdt:P6612 "SWISSLIPID:000399814" .
    ?lipidEntity rdfs:label ?lipidEntityLabel .
    FILTER(LANG(?lipidEntityLabel) = "en") .
  }
}

# https://sparql.rhea-db.org/sparql
PREFIX rhea: <http://rdf.rhea-db.org/>
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX bgee: <http://bgee.org/>

SELECT DISTINCT ?gene ?enzyme ?reaction
WHERE {
  # Query Rhea for enzymes and their associated reactions
  SERVICE <https://sparql.rhea-db.org/sparql> {
    ?reaction rhea:catalyzedBy ?enzyme .
    ?enzyme a obo:GO_0003824 . # GO term for enzyme activity
  }

  # Use Bgee to link to genes
  SERVICE <https://bgee.org/sparql> { 
    ?gene obo:RO_0002204 ?enzyme . # Relation for 'gene product encoded by'
    FILTER EXISTS { ?gene obo:NCBITaxon_9606 ?any } . # Simplified filter for human genes
  }
}

# https://sparql.rhea-db.org/sparql
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX rhea: <http://rdf.rhea-db.org/reaction/>

SELECT DISTINCT ?protein ?reaction ?ecnumber
WHERE {
    # Identify the CHEBI ID for arachidonate
    VALUES ?chebi {obo:CHEBI_32395}

    # Query Rhea to find reactions associated with arachidonate
    SERVICE <https://sparql.rhea-db.org/sparql> {
        ?reaction rhea:side ?side .
        ?side rhea:contains ?chebi .
        ?reaction rhea:catalyzedBy ?protein .
    }

    # Retrieve EC numbers associated with the reactions
    ?reaction obo:RO_0000057 ?ecnumber .
}

