# https://sib-federated.rhea-db.org/sparql
PREFIX rr: <http://rdf.rhea-db.org/>
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rh: <http://rdf.rhea-db.org/reaction/>

SELECT (SUM(?count) AS ?total_links)
WHERE {
  {
    SELECT (COUNT(DISTINCT ?reaction) AS ?count)
    WHERE {
      SERVICE <https://sparql.rhea-db.org/sparql> {
        ?reaction rh:ec ?ec .
        ?reaction rh:status ?status .
        FILTER (?status = "standard" || ?status = "unbalanced")
      }
    }
  }
  UNION
  {
    SELECT (COUNT(DISTINCT ?protein) AS ?count)
    WHERE {
      SERVICE <https://sparql.uniprot.org/sparql> {
        ?protein up:enzyme ?ec .
      }
    }
  }
}

# https://www.ebi.ac.uk/rdf/services/sparql
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX rhea: <http://rdf.rhea-db.org/>
PREFIX chebi: <http://purl.obolibrary.org/obo/CHEBI_>

SELECT DISTINCT ?parent_reaction ?enzyme ?metabolite
WHERE {
  # Define the given metabolite
  VALUES ?metabolite {obo:CHEBI_83137}

  # Query Rhea to find reactions involving the given metabolite
  SERVICE <https://sparql.rhea-db.org/sparql> {
    ?reaction rhea:side ?side .
    ?side ?p ?metabolite .
    ?reaction rhea:equation ?equation .
    ?reaction rhea:direction ?direction .

    # Identify the parent reaction
    ?parent_reaction rhea:reaction ?reaction .
  }

  # Query Rhea to find enzymes catalyzing the parent reaction
  SERVICE <https://sparql.rhea-db.org/sparql> {
    ?parent_reaction rhea:catalyzedBy ?enzyme .
  }

  # Optionally, fetch additional information about the metabolite from ChEBI
  SERVICE <https://www.ebi.ac.uk/rdf/services/sparql> {
    ?metabolite obo:IAO_0000115 ?description .
  }
}
